import React, { Component } from 'react';

class Footer extends Component {
    constructor(){
        super();
    }
    render(){
        return(
            <div className = "conntainer">
                <div className = "control-label">
                    <input 
                        defaultValue = "https://medium.com/javascript-in-plain-english/full-stack-mongodb-react-node-js-express-js-in-one-simple-app-6cc8ed6de274"
                        className = "form-control"
                        value = "https://medium.com/javascript-in-plain-english/full-stack-mongodb-react-node-js-express-js-in-one-simple-app-6cc8ed6de274"
                    />
                    <input 
                        className = "form-control"
                        value = "https://bootswatch.com/lux/"
                    />
                </div>
            </div>
        );
    }

}
export default Footer;
